import { createMuiTheme } from '@material-ui/core/styles';

const argosBlue = "#0B72B9";
const argosYellow = "#FFBA60";

export default createMuiTheme({
    palette: {
        common: {
            argosBlue: `${argosBlue}`,
            argosYellow: `${argosYellow}`
        },
        primary: {
            main: `${argosBlue}`
        }
    }
})
